// src/pages/Home.js
import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar";
import Map from "../components/Map";
import CarCard from "../components/CarCard";
import { fetchRentalOffices } from "../services/rentalOfficeService";

const Home = () => {
  const [offices, setOffices] = useState([]);
  const [searchLocation, setSearchLocation] = useState({ lat: 0, lng: 0 });

  useEffect(() => {
    if (searchLocation.lat && searchLocation.lng) {
      fetchRentalOffices(searchLocation.lat, searchLocation.lng).then(setOffices);
    }
  }, [searchLocation]);

  return (
    <div>
      <Navbar />
      <div style={{ padding: "1rem" }}>
        <h2>Welcome to Car Rental</h2>
        <input
          type="text"
          placeholder="Search for a location..."
          style={styles.input}
          onBlur={(e) =>
            setSearchLocation({
              lat: parseFloat(e.target.value.split(",")[0]),
              lng: parseFloat(e.target.value.split(",")[1]),
            })
          }
        />
        <Map setLocation={setSearchLocation} />
        <h3>Nearby Rental Offices</h3>
        {offices.length > 0 ? (
          offices.map((office) => <CarCard key={office.id} office={office} />)
        ) : (
          <p>No offices found nearby.</p>
        )}
      </div>
    </div>
  );
};

const styles = {
  input: {
    padding: "0.5rem",
    marginBottom: "1rem",
    width: "100%",
    border: "1px solid #ddd",
    borderRadius: "4px",
  },
};

export default Home;
